import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

function ViewRegistration() {
  const [companyDetails, setCompanyDetails] = useState(null);
  const [companies, setCompanies] = useState([]);
  const [notificationMessage, setNotificationMessage] = useState('');
  const [acceptedCompany, setAcceptedCompany] = useState(null);

  const navigate = useNavigate();

  useEffect(() => {
    const storedCompanies = JSON.parse(localStorage.getItem('companies')) || [];
    setCompanies(storedCompanies);
  }, []);

  const handleCompanyClick = (company) => {
    setCompanyDetails(company);
  };

  const handleCloseSidebar = () => {
    setCompanyDetails(null);
  };

  const handleAccept = (company) => {
    // Set the company as accepted and show a success notification
    setAcceptedCompany(company);
    setNotificationMessage(`Congratulations! Your company "${company.companyName}" has been accepted.`);
    setCompanyDetails(null); // Close the sidebar after accepting
    // Optionally, you can update the company list in the local storage here
  };

  const handleReject = (company) => {
    // Show a rejection notification
    setNotificationMessage(`Sorry, your company "${company.companyName}" has been rejected.`);
    setCompanyDetails(null); // Close the sidebar after rejecting
    // Optionally, you can remove the company from the local storage here
  };

  return (
    <div>
      <h1 style={{ textAlign: 'center' }}>Company Registration View</h1>

      {/* Notification Message */}
      {notificationMessage && (
        <div style={{ textAlign: 'center', marginBottom: '20px', color: 'green', fontSize: '16px' }}>
          {notificationMessage}
        </div>
      )}

      {/* List of Companies */}
      <div style={{ margin: '20px', textAlign: 'center' }}>
        <h2>Companies</h2>
        <div>
          {companies.length > 0 ? (
            companies.map((company, index) => (
              <p key={index}>
                <button
                  onClick={() => handleCompanyClick(company)}
                  style={{
                    fontSize: '18px',
                    color: 'blue',
                    background: 'none',
                    border: 'none',
                    textDecoration: 'underline',
                    cursor: 'pointer',
                    padding: '0',
                  }}
                >
                  {company.companyName}
                </button>
              </p>
            ))
          ) : (
            <p>No companies found</p>
          )}
        </div>
      </div>

      {/* Sidebar showing company details */}
      {companyDetails && (
        <div
          style={{
            position: 'fixed',
            top: 0,
            right: 0,
            width: '350px',
            height: '100vh',
            backgroundColor: '#f8f9fa',
            boxShadow: '-2px 0 5px rgba(0,0,0,0.2)',
            padding: '20px',
            zIndex: 1000,
            overflowY: 'auto',
          }}
        >
          <button
            onClick={handleCloseSidebar}
            style={{
              position: 'absolute',
              top: '10px',
              right: '10px',
              padding: '5px 10px',
              backgroundColor: 'red',
              color: 'white',
              border: 'none',
              cursor: 'pointer',
            }}
          >
            Close
          </button>
          <h2 style={{ textAlign: 'center' }}>Company Details</h2>

          <div style={{ textAlign: 'center', marginBottom: '15px' }}>
            {companyDetails.companyLogo ? (
              <img
                src={companyDetails.companyLogo}
                alt={`${companyDetails.companyName} logo`}
                style={{ width: '150px', height: '150px', borderRadius: '50%' }}
              />
            ) : (
              <p>No logo uploaded</p>
            )}
            <h3>{companyDetails.companyName}</h3>
          </div>

          <p><strong>Industry:</strong> {companyDetails.industry}</p>
          <p><strong>Company Size:</strong> {companyDetails.companySize}</p>
          <p><strong>Email:</strong> {companyDetails.companyEmail}</p>

          <div style={{ marginTop: '20px' }}>
            <button
              onClick={() => handleAccept(companyDetails)}
              style={{
                padding: '10px 20px',
                backgroundColor: '#4CAF50',
                color: 'white',
                border: 'none',
                borderRadius: '5px',
                cursor: 'pointer',
                marginRight: '10px',
              }}
            >
              Accept
            </button>
            <button
              onClick={() => handleReject(companyDetails)}
              style={{
                padding: '10px 20px',
                backgroundColor: '#f44336',
                color: 'white',
                border: 'none',
                borderRadius: '5px',
                cursor: 'pointer',
              }}
            >
              Reject
            </button>
          </div>
        </div>
      )}
    </div>
  );
}

export default ViewRegistration;
